module.exports = "<body>\n<mat-toolbar>\n  <p>Adam programuje</p>\n  <i class=\"left fa fa-thumbs-up fa-2x\" aria-hidden=\"true\"></i>\n  <i class=\"right fa fa-envelope fa-2x\" aria-hidden=\"true\" href=\"mailto:adam_polczynski@yahoo.com\"></i>\n\n</mat-toolbar>\n<mat-tab-group class=\"rounded-bottom\" [(selectedIndex)]=\"selectedIndex\">\n  <div></div>\n  <mat-tab id=\"tab\" label=\"Aplikacje mobilne\">\n    <div class=\"main-content container-fluid rounded\">\n      <div class=\"container\">\n        <h3 style=\"text-align: center\">Apki na wyciągniecie lapki!</h3><hr>\n        <p class=\"text-center\">Myslales kiedys o tyms, by dotrzec do swoich klientow za pomoca\n        nowoczesnych aplikacji na telefon? Kazdy uzywa telefonu opartego na systemie Android czy iOS, razem jestesmy w stanie\n        bez problemu zaimplementowac okreslone funkcje (ogranicza nas wyobraznia)</p>\n        <p class=\"text-center\" style=\"font-style: italic;\">\"Programowanie to nie sztuka, sztuką jest finalizować projekty\"</p>\n      </div>\n    </div>\n\n  </mat-tab>\n  <mat-tab label=\"Strony internetowe\">\n    <div class=\"main-content container-fluid\">\n      <div class=\"container\">\n        <h3 class=\"text-center\">Front-end, back-end, full-service!</h3><hr>\n        <p class=\"text-center\">Mamy rok 2017 i mnostwo dostepnych technologii, ktore umozliwiaja szybko\n        zaprogramowac w pelni funkcjonalna, ladna i bezpieczna aplikacje, bledem byloby ich nie wykorzystac!</p>\n        <p class=\"text-center\" style=\"font-style: italic;\">\"Dobry programista to przede wszystkim\n          jakosc jego produktu\"</p>\n      </div>\n    </div>\n  </mat-tab>\n  <mat-tab label=\"Bazy danych\">\n    <div class=\"main-content container-fluid\">\n      <div class=\"container\">\n        <h3 class=\"text-center\">Operacje na bazach danych</h3><hr>\n        <p  class=\"text-center\">Każda szanująca sie (w pelni funkcjonalna) aplikacja internetowa\n          dysponuje 'podlaczona' do siebie baza danych na ktorej wykonuje operacje</p>\n        <p  class=\"text-center\">Pozwala nam przechowywac dane i zachowywac miedzy nimi okreslone relacje.</p>\n        <p class=\"text-center\">Osobiscie jestem fanem MongoDB - bazy danych opierajacej swoje istnieje na formacie,\n        bardzo powszechnym formacie, JSON.</p>\n      </div>\n    </div>\n  </mat-tab>\n  <mat-tab label=\"O mnie\">\n    <div class=\"main-content container-fluid \">\n      <h3 class=\"text-center\">Kim to ja jestem?</h3><hr>\n      <p class=\"text-center\">\n        Pasjonuje się programowaniem, sieciami komputerowymi, zarządzaniem danymi (bazy danych) i innymi technicznymi tematami.\n        Koduję od czasów gimnazjum, stąd miałem czas na zapoznanie się z różnymi technikami.\n      </p>\n      <p class=\"text-center\">\n        Mieszkam w Poznaniu, skupiam się na rozwoju kilku moich projektów. W ramach rozrywki - gram na gitarze.\n        Chcesz się skontaktować? Kliknij w koperte na gorze strony.\n      </p>\n    </div>\n  </mat-tab>\n</mat-tab-group>\n<div class=\"row\" *ngIf=\"selectedIndex==3\">\n  <div class=\"col-xs-12 col-sm-12 col-md-12 col-lg-12\"style=\"height: 300px;\"  >\n    <img class=\"grid-image-h img-thumbnail mx-auto d-block\" src=\"../../../assets/img/wybrane.jpg\" alt=\"tracker\">\n  </div>\n</div>\n<div class=\"row\" *ngIf=\"selectedIndex==2\">\n  <div class=\"col-xs-12 col-sm-12 col-md-12 col-lg-12\"style=\"height: 300px;\"  >\n    <img class=\"grid-image-w img-thumbnail mx-auto d-block\" src=\"../../../assets/img/databases.png\" alt=\"tracker\">\n  </div>\n</div>\n<div class=\"row\" *ngIf=\"selectedIndex==1\">\n  <div class=\"col-xs-12 col-sm-12 col-md-12 col-lg-12\">\n    <img class=\"grid-image-w img-thumbnail mx-auto d-block\" src=\"{{images[selectedIndex]}}\" alt=\"tracker\">\n  </div>\n</div>\n  <div class=\"row\" style=\"height: 300px;\" *ngIf=\"selectedIndex==0\">\n    <div class=\"col-xs-12 col-sm-12 col-md-6 col-lg-4\"style=\"height: 300px;\"  >\n      <img class=\"grid-image-h img-thumbnail mx-auto d-block\" src=\"{{images[selectedIndex]}}\" alt=\"tracker\">\n    </div>\n\n    <div class=\"hidden-sm-down col-md-6 col-lg-4\">\n      <img class=\"grid-image-h img-thumbnail mx-auto d-block\" src=\"{{images2[selectedIndex]}}\" alt=\"tracker\">\n    </div>\n    <div class=\"hidden-md-down col-lg-4\">\n      <img class=\"grid-image-h img-thumbnail mx-auto d-block\" src=\"../../../assets/img/mpc.png\" alt=\"tracker\">\n    </div>\n  </div>\n\n\n  <!--<mat-grid-list cols=\"{{getColNumber()}}\" rowHeight=\"1:1\">-->\n  <!--<mat-grid-tile>-->\n  <!--<img [ngClass]=\"{'grid-image-h': !isImageWide(),'grid-image-w' : isImageWide()}\" class=\"img-thumbnail\" src=\"{{images[selectedIndex]}}\" alt=\"tracker\">-->\n  <!--</mat-grid-tile>-->\n  <!--<mat-grid-tile *ngIf=\"selectedIndex==0\">-->\n  <!--<img class=\"grid-image-h img-thumbnail\" src=\"{{images2[selectedIndex]}}\" alt=\"tracker\">-->\n\n  <!--</mat-grid-tile>-->\n  <!--<mat-grid-tile *ngIf=\"selectedIndex==0\">-->\n  <!--<img class=\"grid-image-h img-thumbnail\" src=\"../../../assets/img/mpc.png\" alt=\"tracker\">-->\n  <!--</mat-grid-tile>-->\n  <!--</mat-grid-list>-->\n  <div class=\"main-content secondary-content container-fluid rounded\">\n    <div class=\"container text-center\">\n      <h3 style=\"text-align: center\">Potrzebujesz aplikacji?!</h3>\n      <p style=\"text-align: center; margin-top: 10px;\">Przemyslmy to razem, moze zreazlizujemy Twoj projekt!\n        <br>\n        Gotow podjac sie misji realizacji?</p>\n      <button class=\"btn btn-default\" style=\"background-color: darkgrey; border-color: whitesmoke; width: 160px; cursor: pointer;\" href=\"mailto:adam_polczynski@yahoo.com\">Realizujmy!</button>\n    </div>\n  </div>\n</body>\n"

